import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import { Divider } from '@material-ui/core';
import Roomcard from './Roomcard';
import axios from 'axios';
import { useState, useEffect } from 'react';

const useStyles = makeStyles((theme) => ({
    root: {
        flexGrow: 1,
        margin: theme.spacing(1),
        marginRight: 40

    },
    papercard: {
        width: '1163px',
        boxShadow: "0px 0px 0px #E8E8E8",
        minHeight: '233px',
        //   margin: 'auto',
        marginLeft: 0,
        marginBottom: "4px",
        //   backgroundColor:'green',
        position: 'relative',

    },
    floortext: {
        display: 'inline',
        marginRight: '162px',
        color: '#4A4A4A',
        fontSize: '13px',
        fontWeight: 'bold',
        position: 'relative'
    },
    headfloor: {
        // display: 'block',
        color: '#4A4A4A',
        fontWeight: 'bold',
        fontSize: '16px',
        posiotion: 'absolute',
        marginLeft: '45px',
        paddingTop: '14px'
    },
    minitext: {
        fontSize: '11.3px',
        color: '#AAAAAA',
        position: 'absolute',
        fontWeight: '300',
        marginLeft: '643.5px',
        top: 0,
        marginTop: '25px'
    }
}));

export default function Floorcard(props) {
    const classes = useStyles();
    const str = props.Date



    //API id, current date and role haven't been add yet

    return (
        <div>
            <Paper className={classes.papercard}>
                <div className={classes.headfloor} >
                    Floor 1
                    <div style={{ position: 'absolute', paddingTop: '6px' }}>

                        <div className={classes.floortext}>
                            Room
                        </div>
                        <div className={classes.floortext}>
                            Billed at
                        </div>
                        <div className={classes.floortext}>
                            Occupants
                        </div>
                        <div className={classes.floortext}>
                            Total
                        </div>
                        <div className={classes.minitext}> (THB) </div>
                        <div className={classes.floortext}>
                            Status
                        </div>
                        <div className={classes.floortext}>
                            Detail
                        </div>
                    </div>
                </div>
                <Divider style={{ backgroundColor: "#AAAAAA", marginTop: "50px" }} />
                {/* <Roomcard /> */}
                {props.class}
            </Paper>
        </div>
    );
}
